import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './components/Home'; // Make sure these paths are correct
import Login from './components/Login'; // Make sure these paths are correct
import Register from './components/Register'; // Make sure these paths are correct
import Dashboard from './components/Dashboard'; // Make sure these paths are correct

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/dashboard" element={<Dashboard />} />
      </Routes>
    </Router>
  );
}

export default App;
